import{_ as a,c as t,o as n,ag as s}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"gpload","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/utility_guide/ref/gpload.md","filePath":"docs/7x/utility_guide/ref/gpload.md"}'),o={name:"docs/7x/utility_guide/ref/gpload.md"};function i(r,e,l,p,d,c){return n(),t("div",null,e[0]||(e[0]=[s('<h1 id="gpload" tabindex="-1">gpload <a class="header-anchor" href="#gpload" aria-label="Permalink to &quot;gpload&quot;">​</a></h1><p>Runs a load job as defined in a YAML formatted control file.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>gpload -f &lt;control_file&gt; [-l &lt;log_file&gt;] [-h &lt;hostname&gt;] [-p &lt;port&gt;] </span></span>\n<span class="line"><span>   [-U &lt;username&gt;] [-d &lt;database&gt;] [-W] [--gpfdist_timeout &lt;seconds&gt;] </span></span>\n<span class="line"><span>   [--no_auto_trans] [--max_retries &lt;retry_times&gt;] [[-v | -V] [-q]] [-D]</span></span>\n<span class="line"><span></span></span>\n<span class="line"><span>gpload -? </span></span>\n<span class="line"><span></span></span>\n<span class="line"><span>gpload --version</span></span></code></pre></div><h2 id="requirements" tabindex="-1"><a id="section3"></a>Requirements <a class="header-anchor" href="#requirements" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Requirements&quot;">​</a></h2><p>The client machine where <code>gpload</code> is run must have the following:</p><ul><li>The <a href="./gpfdist.html">gpfdist</a> parallel file distribution program installed and in your <code>$PATH</code>. This program is located in <code>$GPHOME/bin</code> of your WarehousePG server installation.</li><li>Network access to and from all hosts in your WarehousePG cluster (coordinator and segments).</li><li>Network access to and from the hosts where the data to be loaded resides (ETL servers).</li></ul><h2 id="description" tabindex="-1"><a id="section4"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>gpload</code> is a data loading utility that acts as an interface to the WarehousePG external table parallel loading feature. Using a load specification defined in a YAML formatted control file, <code>gpload</code> runs a load by invoking the WarehousePG parallel file server (<a href="./gpfdist.html">gpfdist</a>), creating an external table definition based on the source data defined, and running an <code>INSERT</code>, <code>UPDATE</code> or <code>MERGE</code> operation to load the source data into the target table in the database.</p><blockquote><p><strong>Note</strong> <code>gpfdist</code> is compatible only with the WarehousePG major version in which it is shipped. For example, a <code>gpfdist</code> utility that is installed with WarehousePG 6.x cannot be used with WarehousePG 7.x.</p></blockquote><blockquote><p><strong>Note</strong> <code>MERGE</code> and <code>UPDATE</code> operations are not supported if the target table column name is a reserved keyword, has capital letters, or includes any character that requires quotes (&quot; &quot;) to identify the column.</p></blockquote><p>The operation, including any SQL commands specified in the <code>SQL</code> collection of the YAML control file (see <a href="#section7">Control File Format</a>), are performed as a single transaction to prevent inconsistent data when performing multiple, simultaneous load operations on a target table.</p><h2 id="options" tabindex="-1"><a id="section5"></a>Options <a class="header-anchor" href="#options" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Options&quot;">​</a></h2><p>-f control_file : Required. A YAML file that contains the load specification details. See <a href="#section7">Control File Format</a>.</p><p>--gpfdist_timeout seconds : Sets the timeout for the <code>gpfdist</code> parallel file distribution program to send a response. Enter a value from <code>0</code> to <code>30</code> seconds (entering &quot;<code>0</code>&quot; to deactivates timeouts). Note that you might need to increase this value when operating on high-traffic networks.</p><p>-l log_file : Specifies where to write the log file. Defaults to <code>~/gpAdminLogs/gpload_YYYYMMDD</code>. For more information about the log file, see <a href="#section9">Log File Format</a>.</p><p>--no_auto_trans : Specify <code>--no_auto_trans</code> to deactivate processing the load operation as a single transaction if you are performing a single load operation on the target table.</p><p>: By default, <code>gpload</code> processes each load operation as a single transaction to prevent inconsistent data when performing multiple, simultaneous operations on a target table.</p><p>-q (no screen output) : Run in quiet mode. Command output is not displayed on the screen, but is still written to the log file.</p><p>-D (debug mode) : Check for error conditions, but do not run the load.</p><p>-v (verbose mode) : Show verbose output of the load steps as they are run.</p><p>-V (very verbose mode) : Shows very verbose output.</p><p>-? (show help) : Show help, then exit.</p><p>--version : Show the version of this utility, then exit.</p><p><strong>Connection Options</strong></p><p>-d database : The database to load into. If not specified, reads from the load control file, the environment variable <code>$PGDATABASE</code> or defaults to the current system user name.</p><p>-h hostname : Specifies the host name of the machine on which the WarehousePG coordinator database server is running. If not specified, reads from the load control file, the environment variable <code>$PGHOST</code> or defaults to <code>localhost</code>.</p><p>-p port : Specifies the TCP port on which the WarehousePG coordinator database server is listening for connections. If not specified, reads from the load control file, the environment variable <code>$PGPORT</code> or defaults to 5432.</p><p>--max_retries retry_times : Specifies the maximum number of times <code>gpload</code> attempts to connect to WarehousePG after a connection timeout. The default value is <code>0</code>, do not attempt to connect after a connection timeout. A negative integer, such as <code>-1</code>, specifies an unlimited number of attempts.</p><p>-U username : The database role name to connect as. If not specified, reads from the load control file, the environment variable <code>$PGUSER</code> or defaults to the current system user name.</p><p>-W (force password prompt) : Force a password prompt. If not specified, reads the password from the environment variable <code>$PGPASSWORD</code> or from a password file specified by <code>$PGPASSFILE</code> or in <code>~/.pgpass</code>. If these are not set, then <code>gpload</code> will prompt for a password even if <code>-W</code> is not supplied.</p><h2 id="control-file-format" tabindex="-1"><a id="section7"></a>Control File Format <a class="header-anchor" href="#control-file-format" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Control File Format&quot;">​</a></h2><p>The <code>gpload</code> control file uses the <a href="http://yaml.org/spec/1.1/" target="_blank" rel="noreferrer">YAML 1.1</a> document format and then implements its own schema for defining the various steps of a WarehousePG load operation. The control file must be a valid YAML document.</p><p>The <code>gpload</code> program processes the control file document in order and uses indentation (spaces) to determine the document hierarchy and the relationships of the sections to one another. The use of white space is significant. White space should not be used simply for formatting purposes, and tabs should not be used at all.</p><p>The basic structure of a load control file is:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>---</span></span>\n<span class="line"><span>VERSION: 1.0.0.1</span></span>\n<span class="line"><span>DATABASE: &lt;db_name&gt;</span></span>\n<span class="line"><span>USER: &lt;db_username&gt;</span></span>\n<span class="line"><span>HOST: &lt;coordinator_hostname&gt;</span></span>\n<span class="line"><span>PORT: &lt;coordinator_port&gt;</span></span>\n<span class="line"><span>GPLOAD:</span></span>\n<span class="line"><span>   INPUT:</span></span>\n<span class="line"><span>    - SOURCE:</span></span>\n<span class="line"><span>         LOCAL_HOSTNAME:</span></span>\n<span class="line"><span>           - &lt;hostname_or_ip&gt;</span></span>\n<span class="line"><span>         PORT: &lt;http_port&gt;</span></span>\n<span class="line"><span>       | PORT_RANGE: [&lt;start_port_range&gt;, &lt;end_port_range&gt;]</span></span>\n<span class="line"><span>         FILE: </span></span>\n<span class="line"><span>           - &lt;/path/to/input_file&gt;</span></span>\n<span class="line"><span>         SSL: true | false</span></span>\n<span class="line"><span>         CERTIFICATES_PATH: &lt;/path/to/certificates&gt;</span></span>\n<span class="line"><span>    - FULLY_QUALIFIED_DOMAIN_NAME: true | false</span></span>\n<span class="line"><span>    - COLUMNS:</span></span>\n<span class="line"><span>           - &lt;field_name&gt;: &lt;data_type&gt;</span></span>\n<span class="line"><span>    - TRANSFORM: &#39;&lt;transformation&gt;&#39;</span></span>\n<span class="line"><span>    - TRANSFORM_CONFIG: &#39;&lt;configuration-file-path&gt;&#39; </span></span>\n<span class="line"><span>    - MAX_LINE_LENGTH: &lt;integer&gt; </span></span>\n<span class="line"><span>    - FORMAT: text | csv</span></span>\n<span class="line"><span>    - DELIMITER: &#39;&lt;delimiter_character&gt;&#39;</span></span>\n<span class="line"><span>    - ESCAPE: &#39;&lt;escape_character&gt;&#39; | &#39;OFF&#39;</span></span>\n<span class="line"><span>    - NEWLINE: &#39;LF&#39; | &#39;CR&#39; | &#39;CRLF&#39;</span></span>\n<span class="line"><span>    - NULL_AS: &#39;&lt;null_string&gt;&#39;</span></span>\n<span class="line"><span>    - FILL_MISSING_FIELDS: true | false</span></span>\n<span class="line"><span>    - FORCE_NOT_NULL: true | false</span></span>\n<span class="line"><span>    - QUOTE: &#39;&lt;csv_quote_character&gt;&#39;</span></span>\n<span class="line"><span>    - HEADER: true | false</span></span>\n<span class="line"><span>    - ENCODING: &lt;database_encoding&gt;</span></span>\n<span class="line"><span>    - ERROR_LIMIT: &lt;integer&gt;</span></span>\n<span class="line"><span>    - LOG_ERRORS: true | false</span></span>\n<span class="line"><span>   EXTERNAL:</span></span>\n<span class="line"><span>      - SCHEMA: &lt;schema&gt; | &#39;%&#39;</span></span>\n<span class="line"><span>   OUTPUT:</span></span>\n<span class="line"><span>    - TABLE: &lt;schema.table_name&gt;</span></span>\n<span class="line"><span>    - MODE: insert | update | merge</span></span>\n<span class="line"><span>    - MATCH_COLUMNS:</span></span>\n<span class="line"><span>           - &lt;target_column_name&gt;</span></span>\n<span class="line"><span>    - UPDATE_COLUMNS:</span></span>\n<span class="line"><span>           - &lt;target_column_name&gt;</span></span>\n<span class="line"><span>    - UPDATE_CONDITION: &#39;&lt;boolean_condition&gt;&#39;</span></span>\n<span class="line"><span>    - MAPPING:</span></span>\n<span class="line"><span>              &lt;target_column_name&gt;: &lt;source_column_name&gt; | &#39;&lt;expression&gt;&#39;</span></span>\n<span class="line"><span>   PRELOAD:</span></span>\n<span class="line"><span>    - TRUNCATE: true | false</span></span>\n<span class="line"><span>    - REUSE_TABLES: true | false</span></span>\n<span class="line"><span>    - STAGING_TABLE: &lt;external_table_name&gt;</span></span>\n<span class="line"><span>    - FAST_MATCH: true | false</span></span>\n<span class="line"><span>   SQL:</span></span>\n<span class="line"><span>    - BEFORE: &quot;&lt;sql_command&gt;&quot;</span></span>\n<span class="line"><span>    - AFTER: &quot;&lt;sql_command&gt;&quot;</span></span></code></pre></div><p>VERSION : Optional. The version of the <code>gpload</code> control file schema. The current version is 1.0.0.1.</p><p>DATABASE : Optional. Specifies which database in the WarehousePG cluster to connect to. If not specified, defaults to <code>$PGDATABASE</code> if set or the current system user name. You can also specify the database on the command line using the <code>-d</code> option.</p><p>USER : Optional. Specifies which database role to use to connect. If not specified, defaults to the current user or <code>$PGUSER</code> if set. You can also specify the database role on the command line using the <code>-U</code> option.</p><p>: If the user running <code>gpload</code> is not a WarehousePG superuser, then the appropriate rights must be granted to the user for the load to be processed. See the <em>WarehousePG Reference Guide</em> for more information.</p><p>HOST : Optional. Specifies WarehousePG coordinator host name. If not specified, defaults to localhost or <code>$PGHOST</code> if set. You can also specify the coordinator host name on the command line using the <code>-h</code> option.</p><p>PORT : Optional. Specifies WarehousePG coordinator port. If not specified, defaults to 5432 or <code>$PGPORT</code> if set. You can also specify the coordinator port on the command line using the <code>-p</code> option.</p><p>GPLOAD : Required. Begins the load specification section. A <code>GPLOAD</code> specification must have an <code>INPUT</code> and an <code>OUTPUT</code> section defined.</p><pre><code>INPUT\n:   Required. Defines the location and the format of the input data to be loaded. `gpload` will start one or more instances of the [gpfdist](gpfdist.html) file distribution program on the current host and create the required external table definition\\(s\\) in WarehousePG that point to the source data. Note that the host from which you run `gpload` must be accessible over the network by all WarehousePG hosts \\(coordinator and segments\\).\n\nSOURCE\n:   Required. The `SOURCE` block of an `INPUT` specification defines the location of a source file. An `INPUT` section can have more than one `SOURCE` block defined. Each `SOURCE` block defined corresponds to one instance of the [gpfdist](gpfdist.html) file distribution program that will be started on the local machine. Each `SOURCE` block defined must have a `FILE` specification.\n\nFor more information about using the `gpfdist` parallel file server and single and multiple `gpfdist` instances, see [Loading and Unloading Data](../../admin_guide/load/topics/g-loading-and-unloading-data.html).\n\nLOCAL\\_HOSTNAME\n:   Optional. Specifies the host name or IP address of the local machine on which `gpload` is running. If this machine is configured with multiple network interface cards \\(NICs\\), you can specify the host name or IP of each individual NIC to allow network traffic to use all NICs simultaneously. The default is to use the local machine&#39;s primary host name or IP only.\n\nPORT\n:   Optional. Specifies the specific port number that the [gpfdist](gpfdist.html) file distribution program should use. You can also supply a `PORT_RANGE` to select an available port from the specified range. If both `PORT` and `PORT_RANGE` are defined, then `PORT` takes precedence. If neither `PORT` or `PORT_RANGE` are defined, the default is to select an available port between 8000 and 9000.\n\nIf multiple host names are declared in `LOCAL_HOSTNAME`, this port number is used for all hosts. This configuration is desired if you want to use all NICs to load the same file or set of files in a given directory location.\n\nPORT\\_RANGE\n:   Optional. Can be used instead of `PORT` to supply a range of port numbers from which `gpload` can choose an available port for this instance of the [gpfdist](gpfdist.html) file distribution program.\n\nFILE\n:   Required. Specifies the location of a file, named pipe, or directory location on the local file system that contains data to be loaded. You can declare more than one file so long as the data is of the same format in all files specified.\n\nIf the files are compressed using `gzip` or `bzip2` \\(have a `.gz` or `.bz2` file extension\\), the files will be uncompressed automatically \\(provided that `gunzip` or `bunzip2` is in your path\\).\n\nWhen specifying which source files to load, you can use the wildcard character \\(`*`\\) or other C-style pattern matching to denote multiple files. The files specified are assumed to be relative to the current directory from which `gpload` is run \\(or you can declare an absolute path\\).\n\nSSL\n:   Optional. Specifies usage of SSL encryption. If `SSL` is set to true, `gpload` starts the `gpfdist` server with the `--ssl` option and uses the `gpfdists://` protocol.\n\nCERTIFICATES\\_PATH\n:   Required when SSL is `true`; cannot be specified when SSL is `false` or unspecified. The location specified in `CERTIFICATES_PATH` must contain the following files:\n\n-   The server certificate file, `server.crt`\n-   The server private key file, `server.key`\n-   The trusted certificate authorities, `root.crt`\n\nThe root directory \\(`/`\\) cannot be specified as `CERTIFICATES_PATH`.\n\nFULLY\\_QUALIFIED\\_DOMAIN\\_NAME\n:   Optional. Specifies whether `gpload` resolve hostnames to the fully qualified domain name \\(FQDN\\) or the local hostname. If the value is set to `true`, names are resolved to the FQDN. If the value is set to `false`, resolution is to the local hostname. The default is `false`.\n\nA fully qualified domain name might be required in some situations. For example, if the WarehousePG cluster is in a different domain than an ETL application that is being accessed by `gpload`.\n\nCOLUMNS\n:   Optional. Specifies the schema of the source data file\\(s\\) in the format of `field\\_name:data\\_type`. The `DELIMITER` character in the source file is what separates two data value fields \\(columns\\). A row is determined by a line feed character \\(`0x0a`\\).\n\nIf the input `COLUMNS` are not specified, then the schema of the output `TABLE` is implied, meaning that the source data must have the same column order, number of columns, and data format as the target table.\n\nThe default source-to-target mapping is based on a match of column names as defined in this section and the column names in the target `TABLE`. This default mapping can be overridden using the `MAPPING` section.\n\nTRANSFORM\n:   Optional. Specifies the name of the input transformation passed to `gpload`. For information about XML transformations, see &quot;Loading and Unloading Data&quot; in the *WarehousePG Administrator Guide*.\n\nTRANSFORM\\_CONFIG\n:   Required when `TRANSFORM` is specified. Specifies the location of the transformation configuration file that is specified in the `TRANSFORM` parameter, above.\n\nMAX\\_LINE\\_LENGTH\n:   Optional. Sets the maximum allowed data row length in bytes. Default is 32768. Should be used when user data includes very wide rows (or when `line too long` error message occurs). Should not be used otherwise as it increases resource allocation. Valid range is 32K to 256MB. The upper limit is 1MB on Windows systems.\n\nFORMAT\n:   Optional. Specifies the format of the source data file\\(s\\) - either plain text \\(`TEXT`\\) or comma separated values \\(`CSV`\\) format. Defaults to `TEXT` if not specified. For more information about the format of the source data, see [Loading and Unloading Data](../../admin_guide/load/topics/g-loading-and-unloading-data.html).\n\nDELIMITER\n:   Optional. Specifies a single ASCII character that separates columns within each row \\(line\\) of data. The default is a tab character in TEXT mode, a comma in CSV mode. You can also specify a non- printable ASCII character or a non-printable unicode character, for example: `&quot;\\x1B&quot;` or `&quot;\\u001B&quot;`. The escape string syntax, `E&#39;&lt;character-code&gt;&#39;`, is also supported for non-printable characters. The ASCII or unicode character must be enclosed in single quotes. For example: `E&#39;\\x1B&#39;` or `E&#39;\\u001B&#39;`.\n\nESCAPE\n:   Specifies the single character that is used for C escape sequences \\(such as `\\n`, `\\t`, `\\100`, and so on\\) and for escaping data characters that might otherwise be taken as row or column delimiters. Make sure to choose an escape character that is not used anywhere in your actual column data. The default escape character is a \\\\ \\(backslash\\) for text-formatted files and a `&quot;` \\(double quote\\) for csv-formatted files, however it is possible to specify another character to represent an escape. It is also possible to deactivate escaping in text-formatted files by specifying the value `&#39;OFF&#39;` as the escape value. This is very useful for data such as text-formatted web log data that has many embedded backslashes that are not intended to be escapes.\n\nNEWLINE\n:   Specifies the type of newline used in your data files, one of:\n\n-   LF \\(Line feed, 0x0A\\)\n-   CR \\(Carriage return, 0x0D\\)\n-   CRLF \\(Carriage return plus line feed, 0x0D 0x0A\\).\n\nIf not specified, WarehousePG detects the newline type by examining the first row of data that it receives, and uses the first newline type that it encounters.\n\nNULL\\_AS\n:   Optional. Specifies the string that represents a null value. The default is `\\N` \\(backslash-N\\) in `TEXT` mode, and an empty value with no quotations in `CSV` mode. You might prefer an empty string even in `TEXT` mode for cases where you do not want to distinguish nulls from empty strings. Any source data item that matches this string will be considered a null value.\n\nFILL\\_MISSING\\_FIELDS\n:   Optional. The default value is `false`. When reading a row of data that has missing trailing field values \\(the row of data has missing data fields at the end of a line or row\\), WarehousePG returns an error.\n\nIf the value is `true`, when reading a row of data that has missing trailing field values, the values are set to `NULL`. Blank rows, fields with a `NOT NULL` constraint, and trailing delimiters on a line will still report an error.\n\nSee the `FILL MISSING FIELDS` clause of the [CREATE EXTERNAL TABLE](../../ref_guide/sql_commands/CREATE_EXTERNAL_TABLE.html) command.\n\nFORCE\\_NOT\\_NULL\n:   Optional. In CSV mode, processes each specified column as though it were quoted and hence not a NULL value. For the default null string in CSV mode \\(nothing between two delimiters\\), this causes missing values to be evaluated as zero-length strings.\n\nQUOTE\n:   Required when `FORMAT` is `CSV`. Specifies the quotation character for `CSV` mode. The default is double-quote \\(`&quot;`\\).\n\nHEADER\n:   Optional. Specifies that the first line in the data file\\(s\\) is a header row \\(contains the names of the columns\\) and should not be included as data to be loaded. If using multiple data source files, all files must have a header row. The default is to assume that the input files do not have a header row.\n\nENCODING\n:   Optional. Character set encoding of the source data. Specify a string constant \\(such as `&#39;SQL_ASCII&#39;`\\), an integer encoding number, or `&#39;DEFAULT&#39;` to use the default client encoding. If not specified, the default client encoding is used. For information about supported character sets, see the *WarehousePG Reference Guide*.\n\n&gt; **Note** If you *change* the `ENCODING` value in an existing `gpload` control file, you must manually drop any external tables that were creating using the previous `ENCODING` configuration. `gpload` does not drop and recreate external tables to use the new `ENCODING` if `REUSE_TABLES` is set to `true`.\n\nERROR\\_LIMIT\n:   Optional. Enables single row error isolation mode for this load operation. When enabled, input rows that have format errors will be discarded provided that the error limit count is not reached on any WarehousePG segment instance during input processing. If the error limit is not reached, all good rows will be loaded and any error rows will either be discarded or captured as part of error log information. The default is to cancel the load operation on the first error encountered. Note that single row error isolation only applies to data rows with format errors; for example, extra or missing attributes, attributes of a wrong data type, or invalid client encoding sequences. Constraint errors, such as primary key violations, will still cause the load operation to be cancelled if encountered. For information about handling load errors, see [Loading and Unloading Data](../../admin_guide/load/topics/g-loading-and-unloading-data.html).\n\nLOG\\_ERRORS\n:   Optional when `ERROR_LIMIT` is declared. Value is either `true` or `false`. The default value is `false`. If the value is `true`, rows with formatting errors are logged internally when running in single row error isolation mode. You can examine formatting errors with the WarehousePG built-in SQL function `gp_read_error_log(&#39;&lt;table_name&gt;&#39;)`. If formatting errors are detected when loading data, `gpload` generates a warning message with the name of the table that contains the error information similar to this message.\n\n```\n&lt;timestamp&gt;|WARN|1 bad row, please use GPDB built-in function gp_read_error_log(&#39;table-name&#39;) \n   to access the detailed error row\n```\n\n:   If `LOG_ERRORS: true` is specified, `REUSE_TABLES: true` must be specified to retain the formatting errors in WarehousePG error logs. If `REUSE_TABLES: true` is not specified, the error information is deleted after the `gpload` operation. Only summary information about formatting errors is returned. You can delete the formatting errors from the error logs with the WarehousePG function `gp_truncate_error_log()`.\n\n&gt; **Note** When `gpfdist` reads data and encounters a data formatting error, the error message includes a row number indicating the location of the formatting error. `gpfdist` attempts to capture the row that contains the error. However, `gpfdist` might not capture the exact row for some formatting errors.\n\nFor more information about handling load errors, see &quot;Loading and Unloading Data&quot; in the *WarehousePG Administrator Guide*. For information about the `gp_read_error_log()` function, see the [CREATE EXTERNAL TABLE](../../ref_guide/sql_commands/CREATE_EXTERNAL_TABLE.html) command.\n\nEXTERNAL\n:   Optional. Defines the schema of the external table database objects created by `gpload`.\n\nThe default is to use the WarehousePG `search_path`.\n\n:   SCHEMA\n</code></pre><p>: Required when <code>EXTERNAL</code> is declared. The name of the schema of the external table. If the schema does not exist, an error is returned.</p><p>: If <code>%</code> (percent character) is specified, the schema of the table name specified by <code>TABLE</code> in the <code>OUTPUT</code> section is used. If the table name does not specify a schema, the default schema is used.</p><pre><code>OUTPUT\n:   Required. Defines the target table and final data column values that are to be loaded into the database.\n\nTABLE\n:   Required. The name of the target table to load into.\n\nMODE\n:   Optional. Defaults to `INSERT` if not specified. There are three available load modes:\n\nINSERT - Loads data into the target table using the following method:\n\n```\nINSERT INTO &lt;target_table&gt; SELECT * FROM &lt;input_data&gt;;\n```\n\nUPDATE - Updates the `UPDATE_COLUMNS` of the target table where the rows have `MATCH_COLUMNS` attribute values equal to those of the input data, and the optional `UPDATE_CONDITION` is true. `UPDATE` is not supported if the target table column name is a reserved keyword, has capital letters, or includes any character that requires quotes \\(&quot; &quot;\\) to identify the column.\n\nMERGE - Inserts new rows and updates the `UPDATE_COLUMNS` of existing rows where attribute values are equal to those of the input data, and the optional `MATCH_COLUMNS` is true. New rows are identified when the `MATCH_COLUMNS` value in the source data does not have a corresponding value in the existing data of the target table. In those cases, the **entire row** from the source file is inserted, not only the `MATCH` and `UPDATE` columns. If there are multiple new `MATCH_COLUMNS` values that are the same, only one new row for that value will be inserted. Use `UPDATE_CONDITION` to filter out the rows to discard. `MERGE` is not supported if the target table column name is a reserved keyword, has capital letters, or includes any character that requires quotes \\(&quot; &quot;\\) to identify the column.\n\nMATCH\\_COLUMNS\n:   Required if `MODE` is `UPDATE` or `MERGE`. Specifies the column\\(s\\) to use as the join condition for the update. The attribute value in the specified target column\\(s\\) must be equal to that of the corresponding source data column\\(s\\) in order for the row to be updated in the target table.\n\nUPDATE\\_COLUMNS\n:   Required if `MODE` is `UPDATE` or `MERGE`. Specifies the column\\(s\\) to update for the rows that meet the `MATCH_COLUMNS` criteria and the optional `UPDATE_CONDITION`.\n\nUPDATE\\_CONDITION\n:   Optional. Specifies a Boolean condition \\(similar to what you would declare in a `WHERE` clause\\) that must be met in order for a row in the target table to be updated.\n\nMAPPING\n:   Optional. If a mapping is specified, it overrides the default source-to-target column mapping. The default source-to-target mapping is based on a match of column names as defined in the source `COLUMNS` section and the column names of the target `TABLE`. A mapping is specified as either:\n\n`&lt;target_column_name&gt;: &lt;source_column_name&gt;`\n\nor\n\n`&lt;target_column_name&gt;: &#39;&lt;expression&gt;&#39;`\n\nWhere &lt;expression\\&gt; is any expression that you would specify in the `SELECT` list of a query, such as a constant value, a column reference, an operator invocation, a function call, and so on.\n</code></pre><p>PRELOAD : Optional. Specifies operations to run prior to the load operation. Right now the only preload operation is <code>TRUNCATE</code>.</p><pre><code>TRUNCATE\n:   Optional. If set to true, `gpload` will remove all rows in the target table prior to loading it. Default is false.\n\nREUSE\\_TABLES\n:   Optional. If set to true, `gpload` will not drop the external table objects and staging table objects it creates. These objects will be reused for future load operations that use the same load specifications. This improves performance of trickle loads \\(ongoing small loads to the same target table\\).\n\nIf `LOG_ERRORS: true` is specified, `REUSE_TABLES: true` must be specified to retain the formatting errors in WarehousePG error logs. If `REUSE_TABLES: true` is not specified, formatting error information is deleted after the `gpload` operation.\n\nIf the &lt;external\\_table\\_name\\&gt; exists, the utility uses the existing table. The utility returns an error if the table schema does not match the `OUTPUT` table schema.\n\nSTAGING\\_TABLE\n:   Optional. Specify the name of the temporary external table that is created during a `gpload` operation. The external table is used by `gpfdist`. `REUSE_TABLES: true` must also specified. If `REUSE_TABLES` is false or not specified, `STAGING_TABLE` is ignored. By default, `gpload` creates a temporary external table with a randomly generated name.\n\nIf external\\_table\\_name contains a period \\(.\\), `gpload` returns an error. If the table exists, the utility uses the table. The utility returns an error if the existing table schema does not match the `OUTPUT` table schema.\n\nThe utility uses the value of [SCHEMA](#cfschema) in the `EXTERNAL` section as the schema for &lt;external\\_table\\_name\\&gt;. If the `SCHEMA` value is `%`, the schema for &lt;external\\_table\\_name\\&gt; is the same as the schema of the target table, the schema of [TABLE](#cftable) in the `OUTPUT` section.\n\nIf `SCHEMA` is not set, the utility searches for the table \\(using the schemas in the database `search_path`\\). If the table is not found, external\\_table\\_name is created in the default `PUBLIC` schema.\n\n`gpload` creates the staging table using the distribution key\\(s\\) of the target table as the distribution key\\(s\\) for the staging table. If the target table was created `DISTRIBUTED RANDOMLY`, `gpload` uses `MATCH_COLUMNS` as the staging table&#39;s distribution key\\(s\\).\n\nFAST\\_MATCH\n:   Optional. If set to true, `gpload` only searches the database for matching external table objects when reusing external tables. The utility does not check the external table column names and column types in the catalog table `pg_attribute` to ensure that the table can be used for a `gpload` operation. Set the value to true to improve `gpload` performance when reusing external table objects and the database catalog table `pg_attribute` contains a large number of rows. The utility returns an error and quits if the column definitions are not compatible.\n\nThe default value is false, the utility checks the external table definition column names and column types.\n\n`REUSE_TABLES: true` must also specified. If `REUSE_TABLES` is false or not specified and `FAST_MATCH: true` is specified, `gpload` returns a warning message.\n</code></pre><p>SQL : Optional. Defines SQL commands to run before and/or after the load operation. You can specify multiple <code>BEFORE</code> and/or <code>AFTER</code> commands. List commands in the order of desired execution.</p><pre><code>BEFORE\n:   Optional. An SQL command to run before the load operation starts. Enclose commands in quotes.\n\nAFTER\n:   Optional. An SQL command to run after the load operation completes. Enclose commands in quotes.\n</code></pre><h2 id="log-file-format" tabindex="-1"><a id="section9"></a>Log File Format <a class="header-anchor" href="#log-file-format" aria-label="Permalink to &quot;&lt;a id=&quot;section9&quot;&gt;&lt;/a&gt;Log File Format&quot;">​</a></h2><p>Log files output by <code>gpload</code> have the following format:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>&lt;timestamp&gt;|&lt;level&gt;|&lt;message&gt;</span></span></code></pre></div><p>Where &lt;timestamp&gt; takes the form: <code>YYYY-MM-DD HH:MM:SS</code>, level is one of <code>DEBUG</code>, <code>LOG</code>, <code>INFO</code>, <code>ERROR</code>, and message is a normal text message.</p><p>Some <code>INFO</code> messages that may be of interest in the log files are (where # corresponds to the actual number of seconds, units of data, or failed rows):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INFO|running time: &lt;#.##&gt; seconds</span></span>\n<span class="line"><span>INFO|transferred &lt;#.#&gt; kB of &lt;#.#&gt; kB.</span></span>\n<span class="line"><span>INFO|gpload succeeded</span></span>\n<span class="line"><span>INFO|gpload succeeded with warnings</span></span>\n<span class="line"><span>INFO|gpload failed</span></span>\n<span class="line"><span>INFO|1 bad row</span></span>\n<span class="line"><span>INFO|&lt;#&gt; bad rows</span></span></code></pre></div><h2 id="notes" tabindex="-1"><a id="section8"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>If your database object names were created using a double-quoted identifier (delimited identifier), you must specify the delimited name within single quotes in the <code>gpload</code> control file. For example, if you create a table as follows:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CREATE TABLE &quot;MyTable&quot; (&quot;MyColumn&quot; text);</span></span></code></pre></div><p>Your YAML-formatted <code>gpload</code> control file would refer to the above table and column names as follows:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>- COLUMNS:</span></span>\n<span class="line"><span>   - &#39;&quot;MyColumn&quot;&#39;: text</span></span>\n<span class="line"><span>OUTPUT:</span></span>\n<span class="line"><span>   - TABLE: public.&#39;&quot;MyTable&quot;&#39;</span></span></code></pre></div><p>If the YAML control file contains the unsupported <code>ERROR_TABLE</code> element, <code>gpload</code> logs a warning stating that <code>ERROR_TABLE</code> is not supported, and load errors are handled as if the <code>LOG_ERRORS</code> and <code>REUSE_TABLE</code> elements were set to <code>true</code>. Rows with formatting errors are logged internally when running in single row error isolation mode.</p><h2 id="examples" tabindex="-1"><a id="section10"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section10&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Run a load job as defined in <code>my_load.yml</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>gpload -f my_load.yml</span></span></code></pre></div><p>Example load control file:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>---</span></span>\n<span class="line"><span>VERSION: 1.0.0.1</span></span>\n<span class="line"><span>DATABASE: ops</span></span>\n<span class="line"><span>USER: gpadmin</span></span>\n<span class="line"><span>HOST: cdw-1</span></span>\n<span class="line"><span>PORT: 5432</span></span>\n<span class="line"><span>GPLOAD:</span></span>\n<span class="line"><span>   INPUT:</span></span>\n<span class="line"><span>    - SOURCE:</span></span>\n<span class="line"><span>         LOCAL_HOSTNAME:</span></span>\n<span class="line"><span>           - etl1-1</span></span>\n<span class="line"><span>           - etl1-2</span></span>\n<span class="line"><span>           - etl1-3</span></span>\n<span class="line"><span>           - etl1-4</span></span>\n<span class="line"><span>         PORT: 8081</span></span>\n<span class="line"><span>         FILE: </span></span>\n<span class="line"><span>           - /var/load/data/*</span></span>\n<span class="line"><span>    - COLUMNS:</span></span>\n<span class="line"><span>           - name: text</span></span>\n<span class="line"><span>           - amount: float4</span></span>\n<span class="line"><span>           - category: text</span></span>\n<span class="line"><span>           - descr: text</span></span>\n<span class="line"><span>           - date: date</span></span>\n<span class="line"><span>    - FORMAT: text</span></span>\n<span class="line"><span>    - DELIMITER: &#39;|&#39;</span></span>\n<span class="line"><span>    - ERROR_LIMIT: 25</span></span>\n<span class="line"><span>    - LOG_ERRORS: true</span></span>\n<span class="line"><span>   OUTPUT:</span></span>\n<span class="line"><span>    - TABLE: payables.expenses</span></span>\n<span class="line"><span>    - MODE: INSERT</span></span>\n<span class="line"><span>   PRELOAD:</span></span>\n<span class="line"><span>    - REUSE_TABLES: true </span></span>\n<span class="line"><span>   SQL:</span></span>\n<span class="line"><span>   - BEFORE: &quot;INSERT INTO audit VALUES(&#39;start&#39;, current_timestamp)&quot;</span></span>\n<span class="line"><span>   - AFTER: &quot;INSERT INTO audit VALUES(&#39;end&#39;, current_timestamp)&quot;</span></span></code></pre></div><h2 id="see-also" tabindex="-1"><a id="section11"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section11&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./gpfdist.html">gpfdist</a>, <a href="./../../ref_guide/sql_commands/CREATE_EXTERNAL_TABLE.html">CREATE EXTERNAL TABLE</a></p>',70)]))}const f=a(o,[["render",i]]);export{u as __pageData,f as default};
